import React from "react";
import styles from './Header.module.scss'
import { Name } from "./Name";
import { HeaderButton } from "./HeaderButton";

const Header = (props) => {
    console.log(props)
    return (
        <div className={styles.Header}>
            <Name />
            <div className={styles.Header__ButtonsBlock}>
                <HeaderButton ref1={props.ref1} text="About us" />
                <HeaderButton ref1={props.ref2} text="Course" />
                <HeaderButton ref1={props.ref3} text="Pricing plans" />
                <HeaderButton ref1={props.ref4} text="Feedbacks" />
                <HeaderButton ref1={props.ref5} text="Contact us" />
            </div>
        </div>
    )
}

export {Header}
